import jxl.*;
import com.eviware.soapui.support.XmlHolder;
import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext;

//Read file from particular location
File filepath=new File("D:\\SOAPProjects\\Test1.xls");
log.info "Reading a file from location $filepath"
Workbook wb=Workbook.getWorkbook(filepath);
Sheet sheet1=wb.getSheet(0);
int row=sheet1.getRows();
def name,id,dept,age
//Reading excel file by each row
for(int i=1;i<row;i++)
{
//Reading data of Row column wise		
name= sheet1.getCell(0,i).getContents();
id= sheet1.getCell(1,i).getContents();
dept= sheet1.getCell(2,i).getContents();
age= sheet1.getCell(3,i).getContents();
log.info "Data fetched from excel for row number $i :::::::: name=$name,id=$id,dept=$dept,age=$age"
MyData1(name,id,dept,age)
getData1(name,id,dept,age)
}

//Method for Add data to SoapRequest for creating a user
def void MyData1(String name,String id,String dept,String age)
{
def request=testRunner.testCase.testSuite.testCases["AddEmpTestcase"].testSteps["addTestStep"].getPropertyValue("Request")
def xmlAdd=new XmlHolder(request);
log.info "Add User:::XML Request before filling details of user is==== $request"
log.info "Add User:::User details which need to send in request :::::::: name=$name,id=$id,dept=$dept,age=$age"
xmlAdd.setNodeValue("//typ:addEmployee/typ:name",name)
xmlAdd.setNodeValue("//typ:addEmployee/typ:id",id)
xmlAdd.setNodeValue("//typ:addEmployee/typ:Department",dept)
xmlAdd.setNodeValue("//typ:addEmployee/typ:age",age)
def newxml=xmlAdd.getXml();
log.info "Add User:::XML Add User Request with all details of user is====$newxml"
testRunner.testCase.testSuite.testCases["AddEmpTestcase"].testSteps["addTestStep"].setPropertyValue("Request",newxml)
log.info "Add User:::Starting Add User Request"
def add=testRunner.testCase.testSuite.testCases["AddEmpTestcase"].testSteps["addTestStep"];
add.run(testRunner,context)
def response=testRunner.testCase.testSuite.testCases["AddEmpTestcase"].testSteps["addTestStep"].getPropertyValue("Response")
log.info "Add User:::Xml Response of addEmployee is====$response"
def xmlresp=new XmlHolder(response);
def result = xmlresp.getNodeValue('//ns:return')
assert result.contains('true')
log.info " Contains true Assertion Successfully passed"
assert !result.contains('false')
log.info "Not Contains false Assertion Successfully passed"
def ResponseHeader = testRunner.testCase.testSuite.testCases["AddEmpTestcase"].testSteps["addTestStep"].testRequest.response.getResponseHeaders()
String  httpStatusCode =ResponseHeader["#status#"];
log.info httpStatusCode
assert httpStatusCode.equals('[HTTP/1.1 200 OK]')
log.info "Status code equals 200k Assertion succesfully passed"
def ResponseTimeinmillisec = testRunner.testCase.testSuite.testCases["AddEmpTestcase"].testSteps["addTestStep"].testRequest.response.timeTaken;
log.info "ResponseTimeinmillisec : $ResponseTimeinmillisec"
assert ResponseTimeinmillisec<=400
log.info "Assertion for ResponseTime less than 400ms is successful"
def responseType = context.expand( '${#Response//*:return}' )
assert responseType.isEmpty() 

}


def void getData1(String name1,String id1,String dept1,String age1)
{
def request1=testRunner.testCase.testSuite.testCases["GetEmpTestcase"].testSteps["getEmpTestStep"].getPropertyValue("Request")
def xmlAdd1=new XmlHolder(request1);
log.info"Get User:::Call to getData of User--->$name1"
xmlAdd1.setNodeValue("//typ:getEmployeeDetails/typ:employeeName",name1)
def newxml1=xmlAdd1.getXml();
testRunner.testCase.testSuite.testCases["GetEmpTestcase"].testSteps["getEmpTestStep"].setPropertyValue("Request",newxml1)
def getdetails=testRunner.testCase.testSuite.testCases["GetEmpTestcase"].testSteps["getEmpTestStep"];
def context11=new WsdlTestRunContext(getdetails);
getdetails.run(testRunner,context11)
def response=testRunner.testCase.testSuite.testCases["GetEmpTestcase"].testSteps["getEmpTestStep"].getPropertyValue("Response")
log.info "Get User:::Xml Response of getdetails is====$response"
def xmlresp=new XmlHolder(response);
def finalname=xmlresp.getNodeValue("//ns:return/ns:name")
def finalid=xmlresp.getNodeValue("//ns:return/ns:id")
def finaldept=xmlresp.getNodeValue("//ns:return/ns:department")
def finalage=xmlresp.getNodeValue("//ns:return/ns:age")
log.info "Get User:::Details we received in getData for User $name1 are id=$finalid,name=$finalname,dept=$finaldept,age=$finalage"
assert name1==finalname,"Actual Name and expected Name are not matched"
assert id1==finalid,"Actual Id and expected Id are not matched"
assert dept1==finaldept,"Actual Department and expected Department are not matched"
assert age1==finalage,"Actual Age and expected Age are not matched"
deleteUser1(finalname);

}

def void deleteUser1(String name1)
{
def request2=testRunner.testCase.testSuite.testCases["DeleteUserTestCase"].testSteps["deleteEmpTestStep"].getPropertyValue("Request")
def xmlAdd2=new XmlHolder(request2);
log.info"Delete User:::Call to deleteEmp --->$name1"
xmlAdd2.setNodeValue("//typ:deleteEmployee//typ:employeeName",name1)	
def newxml2=xmlAdd2.getXml();
testRunner.testCase.testSuite.testCases["DeleteUserTestCase"].testSteps["deleteEmpTestStep"].setPropertyValue("Request",newxml2)
def deleteUser=testRunner.testCase.testSuite.testCases["DeleteUserTestCase"].testSteps["deleteEmpTestStep"]
deleteUser.run(testRunner,context)
log.info "$name1 User Deleted"

}
